var title_f13_16_13575="Ankle block";
var content_f13_16_13575=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F56515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F56515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 556px\">",
"   <div class=\"ttl\">",
"    Ankle block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 536px; height: 565px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Ankle block anesthetizes four branches of the sciatic nerve (superficial peroneal, deep peroneal, posterior tibial, and sural nerves) and one cutaneous branch of the femoral nerve (saphenous nerve). Each nerve is independently anesthetized.",
"    <br>",
"     The deep peroneal nerve innervates the first web space of the foot. The dorsalis pedis artery is palpated and the needle inserted just lateral to the extensor hallucis longus tendon.",
"     <br>",
"      The superficial peroneal nerve supplies the skin over the dorsum of the foot, and is blocked by subcutanous infiltration over the dorsum of the foot starting from the injection site for the deep peroneal nerve (above).",
"      <br>",
"       The posterior tibial nerve provides sensation to the calcaneus and sole of the foot. It is anesthetized by injecting local anesthetic behind the medial malleolus.",
"       <br>",
"        The sural nerve provides cutaneous sensation over the lateral ankle, foot and fifth toe and is adjacent the small saphenous vein. It is blocked by injecting local anesthetic behind the lateral malleolus.",
"        <br>",
"         The saphenous nerve supplies sensation to the skin over the medial aspect of the ankle and foot. It is blocked by injecting a ring of local anesthetic around the great saphenous vein.",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
