var title_f13_16_13580="Etiology of acute pancreatitis";
var content_f13_16_13580=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F78423&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F78423&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiology of acute pancreatitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Mechanical",
"       </td>",
"       <td>",
"        Gallstones, biliary sludge, ascariasis, periampullary diverticulum, pancreatic or periampullary cancer, ampullary stenosis, duodenal stricture or obstruction",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Toxic",
"       </td>",
"       <td>",
"        Ethanol, methanol, scorpion venom, organophosphate poisoning",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Metabolic",
"       </td>",
"       <td>",
"        Hyperlipidemia (types I, IV, V), hypercalcemia",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Drugs",
"       </td>",
"       <td>",
"        Didanosine, pentamidine, metronidazole, stibogluconate, tetracycline furosemide, thiazides, sulphasalazine, 5-ASA, L-asparaginase, azathioprine, valproic acid, sulindac, salicylates, calcium, estrogen",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\" rowspan=\"4\">",
"        Infection",
"       </td>",
"       <td>",
"        Viruses-mumps, coxsackie, hepatitis B, CMV, varicella-zoster, HSV, HIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bacteria-mycoplasma, Legionella, Leptospira, salmonella",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fungi-aspergillus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Parasites-toxoplasma, cryptosporidium, Ascaris",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Trauma",
"       </td>",
"       <td>",
"        Blunt or penetrating abdominal injury, iatrogenic injury during surgery or ERCP (sphincterotomy)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Congenital",
"       </td>",
"       <td>",
"        Cholodochocele type V, ? pancreas divisum",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Vascular",
"       </td>",
"       <td>",
"        Ischemia, atheroembolism, vasculitis (polyarteritis nodosa, SLE)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Miscellaneous",
"       </td>",
"       <td>",
"        Post ERCP, pregnancy, renal transplantation, alpha-1-antitrypsin deficiency",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Genetic",
"       </td>",
"       <td>",
"        CFTR and other genetic mutations",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     5-ASA: 5-aminosalicylic acid; CMV: cytomegalovirus; HSV: herpes simplex virus; HIV: human immunodeficiency virus; ERCP: endoscopic retrograde cholangiopancreatography; SLE: systemic lupus erythematosus; CFTR: cystic fibrosis transmembrane conductance regulator.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
