var title_f13_16_13581="Coexisting emotional and behavioral disorders in ADHD";
var content_f13_16_13581=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F64535&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F64535&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Emotional and behavioral disorders that commonly coexist with attention deficit hyperactivity disorder in children and adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Conduct disorder",
"       </td>",
"       <td>",
"        Repetitive and persistent violation of age-appropriate societal norms, rules, or basic rights of others; includes:",
"        <ul>",
"         <li>",
"          Aggression to people and animals",
"         </li>",
"         <li>",
"          Destruction of property",
"         </li>",
"         <li>",
"          Deceitfulness or theft",
"         </li>",
"         <li>",
"          Serious violations of rules",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Anxiety disorder",
"       </td>",
"       <td>",
"        Persistent, excessive, difficult to control worry about events or activities; associated with:",
"        <ul>",
"         <li>",
"          Restlessness",
"         </li>",
"         <li>",
"          Easy fatigability",
"         </li>",
"         <li>",
"          Difficulty concentrating",
"         </li>",
"         <li>",
"          Irritability",
"         </li>",
"         <li>",
"          Muscle tension",
"         </li>",
"         <li>",
"          Sleep disturbance",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Depression",
"       </td>",
"       <td>",
"        Persistent disturbance in emotions, ideation, or somatic symptoms as indicated by &ge;5 of the following symptoms; at least one of the symptoms in red must be present:",
"        <ul>",
"         <li>",
"          <span style=\"color: #ff0000;\">",
"           Depressed or irritable mood",
"          </span>",
"         </li>",
"         <li>",
"          <span style=\"color: #ff0000;\">",
"           Markedly diminished interest or pleasure in almost all activities",
"          </span>",
"         </li>",
"         <li>",
"          Change in appetite or weight",
"         </li>",
"         <li>",
"          Insomnia or hypersomnia",
"         </li>",
"         <li>",
"          Psychomotor agitation or retardation",
"         </li>",
"         <li>",
"          Fatigue or loss of energy",
"         </li>",
"         <li>",
"          Feelings of worthlessness or guilt",
"         </li>",
"         <li>",
"          Impaired concentration, indecisiveness",
"         </li>",
"         <li>",
"          Recurring thoughts of death or suicide",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Learning disability",
"       </td>",
"       <td>",
"        Intrinsic cognitive difficulty that results in lower academic achievement than expected for intellectual potential; examples include:",
"        <ul>",
"         <li>",
"          Reading disorder",
"         </li>",
"         <li>",
"          Disorder of written language",
"         </li>",
"         <li>",
"          Mathematics disorder",
"         </li>",
"         <li>",
"          Learning disorder, not otherwise specified",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Oppositional defiant disorder",
"       </td>",
"       <td>",
"        Recurrent negative, defiant, disobedient, and hostile behavior toward authority figures, including:",
"        <ul>",
"         <li>",
"          Losing temper",
"         </li>",
"         <li>",
"          Arguing with adults",
"         </li>",
"         <li>",
"          Actively defying or refusing to comply with adults' requests or rules",
"         </li>",
"         <li>",
"          Deliberately annoying people",
"         </li>",
"         <li>",
"          Blaming others for his or her mistakes or misbehavior",
"         </li>",
"         <li>",
"          Being touchy or easily annoyed by others",
"         </li>",
"         <li>",
"          Being angry and resentful",
"         </li>",
"         <li>",
"          Being spiteful or vindictive",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Attention-deficit and disruptive behavior disorders. In: Diagnostic and Statistical Manual of Mental Disorders Fourth Edition Text Revision, 4th ed, American Psychiatric Association, Washington, DC 2000. p.85.",
"       </li>",
"       <li>",
"        Anxiety disorders. In: Diagnostic and Statistical Manual of Mental Disorders Fourth Edition Text Revision, 4th ed, American Psychiatric Association, Washington, DC 2000. p.429.",
"       </li>",
"       <li>",
"        Mood disorders. In: Diagnostic and Statistical Manual of Mental Disorders Fourth Edition Text Revision, 4th ed, American Psychiatric Association, Washington, DC 2000. p.345.",
"       </li>",
"       <li>",
"        Oppositional defiant disorder. In: Diagnostic and Statistical Manual of Mental Disorders Fourth Edition Text Revision, 4th ed, American Psychiatric Association, Washington, DC 2000. p.100.",
"       </li>",
"       <li>",
"        Conduct disorder. In: Diagnostic and Statistical Manual of Mental Disorders Fourth Edition Text Revision, 4th ed, American Psychiatric Association, Washington, DC 2000. p.93.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
